import React, { Component } from 'react';

function Card (props){
 
   const data = props.Data;
     {data&& console.log(data.data.data);}
       return(<>
        <div>
           {data&& data.data.data.map((items,index)=>{
                return (
                    <ul key={index}>
                        <li>first name<span>{items.first_name}</span></li>
                        <li>last name<span>{items.last_name}</span></li>
                        <li>email <span>{items.email}</span></li>
                    </ul>
                )
            })} 
        </div>
       </>)
    
}

export default Card;
